def extended_gcd(a, b):
    if (b == 0):
        return (a, 1, 0)
    (gcd, x1, y1) = extended_gcd(b, (a % b))
    x = y1
    y = (x1 - ((a // b) * y1))
    return (gcd, x, y)




def find_solution(a: int, b: int, n: int) -> tuple:
    (gcd, x0, y0) = extended_gcd(a, b)
    if ((n % gcd) != 0):
        return None
    x = (x0 * (n // gcd))
    y = (y0 * (n // gcd))
    b_div_gcd = (b // gcd)
    a_div_gcd = (a // gcd)
    if (x < 0):
        t = ((((- x) + b_div_gcd) - 1) // b_div_gcd)
        x += (t * b_div_gcd)
        y -= (t * a_div_gcd)
    elif (y < 0):
        t = ((((- y) + a_div_gcd) - 1) // a_div_gcd)
        x -= (t * b_div_gcd)
        y += (t * a_div_gcd)
    return (x, y)

