def sequence(n: int) -> int:
    if ((n == 1) or (n == 2)):
        return 1
    P = ([0] * (n + 1))
    (P[1], P[2]) = (1, 1)
    for i in range(3, (n + 1)):
        P[i] = (P[P[(i - 1)]] + P[(i - P[(i - 1)])])
    return P[n]
